const AltaSuperForm = () =>{
    return(
        <div>
            <form>
                <input type='text' name="nombreReal" placeholder="Nombre real"/>
                <input type='text' name="nombreSuper" placeholder="Nombre de Super Heroe"/>
                <input type='number' name="edad" placeholder="Edad"/>
                <label>Sexo</label>
                Masculino   <input type='radio' name="sexo"/> <br></br>
                Femenino   <input type='radio' name="sexo"/><br></br>
                No especificado   <input type='radio' name="sexo"/><br></br>

                <label>Origen</label>
                Humano   <input type='radio' name="origen"/> <br></br>
                Extraterrestre   <input type='radio' name="origen"/> <br></br>
                Experimento   <input type='radio' name="origen"/> <br></br>
                Mutante   <input type='radio' name="origen"/> <br></br>

                <label>Características</label>
                Volador   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Velocidad   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Fuerza   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Mutante   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Visión   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Oído   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Invulneravilidad   <input type='checkbox' name="poderes"/><br></br>
                Telepatia   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Telequinesis   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Lanza Rayos   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Artes Marciales   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Inteligencia   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Acrobacia   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Armadura   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;
                Tecnologia   <input type='checkbox' name="poderes"/>&nbsp;&nbsp;

                <button>Enviar</button>
                <button>Limpiar</button>
            </form>
        </div>
    )
}

export default AltaSuperForm;
